import React, {useState, useEffect} from 'react';
import { View, Text, Button, TouchableOpacity, StyleSheet, Image } from 'react-native'

const View1 = (props) => {
  const [items, setItems] = React.useState([])

  function APIItems() {
    fetch(props.apiURI + '/items', {
      method: 'GET'
    })
      .then(response => {
        if (response.ok == false) {
          throw new Error("HTTP Code " + response.status + " - " + JSON.stringify(response.json()));
        }
        return response.json();
      })
      .then(json => {
        setItems(json)
        console.log(json);
      })
      .catch(error => {
        console.log("Error message:")
        console.log(error.message)
      });
  }

  useEffect(() => {
    APIItems();
  }, []);
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center', marginTop: -100 }}>
      <Text style={{ fontSize: 50, fontWeight: '700' }}>Cpanel</Text>
      <Text>You have successfully logged in</Text>
      <Button
        title="POST A NEW ITEM"
        onPress={() => props.navigation.navigate('Todos')}
      />
      <Button
        title="Logout"
        onPress={props.onLogout}
      />
      <TouchableOpacity
          style={styles.container}
        >
          <Image style={styles.thumbnail} 
          source={items.images}
 />
          <View style={styles.metaDataContainer}>
            <View style={styles.metaDataContent}>
              <Text style={styles.title}>{items.title}</Text>
              <Text style={styles.description}>{'shdadjsa'}</Text>
            </View>
          </View>
        </TouchableOpacity>
    </View>

  )
}

const styles = StyleSheet.create({
  container: {
    height: 80,
    elevation: 3,
    borderColor: "gray",
    borderRadius: 5,
    flexDirection: "row",
    marginHorizontal: 20,
  },
  metaDataContainer: {
    flex: 1,
  },
  thumbnail: {
    width: 100,
  },
  metaDataContent: {
    marginTop: 5,
    marginLeft: 15,
  },
  title: {
    color: "#444",
    fontSize: 18,
    fontWeight: "bold",
  },
  description: {
    fontSize: 16,
    color: "#888",
    fontWeight: "700",
  },
});

export default View1
